// src/components/LoginPage.jsx
import React from 'react';
import styled from 'styled-components';
import { FaEnvelope, FaGoogle, FaFacebookF } from 'react-icons/fa';

const BREAKPOINT = '768px';

const Page = styled.div`
  display: flex;
  min-height: 100vh;
  background: #0f0b2e;
  color: #fff;
  @media (max-width: ${BREAKPOINT}) {
    flex-direction: column;
  }
`;

const Hero = styled.div`
  flex: 1;
  padding: 4rem;
  display: flex;
  align-items: flex-end;
  background: linear-gradient(135deg, #1b103d, #0f0b2e);
  font-family: 'Poppins', sans-serif;
  font-size: 2.5rem;
  font-weight: bold;
  letter-spacing: 1px;
  color: #7c3aed;
  @media (max-width: ${BREAKPOINT}) {
    align-items: center;
    justify-content: center;
    padding: 2rem;
    text-align: center;
  }
`;

const FormWrapper = styled.div`
  flex: 1;
  padding: 4rem;
  display: flex;
  flex-direction: column;
  justify-content: center;
  @media (max-width: ${BREAKPOINT}) {
    padding: 2rem;
  }
`;

const Title = styled.h1`
  font-size: 2.5rem;
  margin-bottom: 1.5rem;
  color: #fff;
`;

const Label = styled.label`
  font-size: 0.9rem;
  margin-bottom: 0.5rem;
  color: #ccc;
`;

const InputGroup = styled.div`
  position: relative;
  margin-bottom: 1.5rem;
`;

const Icon = styled.div`
  position: absolute;
  top: 50%;
  left: 1rem;
  transform: translateY(-50%);
  color: #777;
`;

const Input = styled.input`
  width: 100%;
  padding: 0.75rem 1rem 0.75rem 3rem;
  border-radius: 8px;
  border: none;
  background: #1b103d;
  color: #eee;
  font-size: 1rem;
  &:focus {
    outline: none;
    box-shadow: 0 0 0 2px #7c3aed33;
  }
`;

const Button = styled.button`
  width: 100%;
  padding: 0.75rem;
  margin-top: 0.5rem;
  border: none;
  border-radius: 8px;
  background: linear-gradient(90deg, #7c3aed, #3b82f6);
  color: white;
  font-size: 1rem;
  cursor: pointer;
  transition: opacity 0.2s ease;
  &:hover { opacity: 0.9; }
`;

const Divider = styled.div`
  text-align: center;
  color: #555;
  margin: 2rem 0;
  &::before,
  &::after {
    content: '';
    display: inline-block;
    width: 30%;
    height: 1px;
    background: #333;
    vertical-align: middle;
    margin: 0 0.5rem;
  }
`;

const SocialButtons = styled.div`
  display: flex;
  gap: 1rem;
  flex-wrap: wrap;
`;

const SocialBtn = styled.button`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 0.75rem 1rem;
  border: none;
  border-radius: 8px;
  background: #1b103d;
  color: #eee;
  font-size: 0.9rem;
  cursor: pointer;
  svg { margin-right: 0.5rem; }
  &:hover { background: #312050; }
`;

export default function LoginPage() {
  return (
    <Page>
      <Hero>YOUR DIGITAL<br/><span style={{ color: '#fff' }}>WARDROBE!</span></Hero>
      <FormWrapper>
        <Title>SIGN IN</Title>
        <Label htmlFor="email">Sign in with email address</Label>
        <InputGroup>
          <Icon><FaEnvelope /></Icon>
          <Input id="email" type="email" placeholder="youremail@gmail.com" />
        </InputGroup>
        <Button>Sign up</Button>
        <Divider>Or continue with</Divider>
        <SocialButtons>
          <SocialBtn><FaGoogle /> Google</SocialBtn>
          <SocialBtn><FaFacebookF /> Facebook</SocialBtn>
        </SocialButtons>
        <small style={{ marginTop: '2rem', color: '#555' }}>
          By registering you agree to our <a href="/terms" style={{ color: '#7c3aed' }}>Terms &amp; Conditions</a>.
        </small>
      </FormWrapper>
    </Page>
  );
}
